def minimum_hackerX_missiles(N, missiles):
    missiles.sort()
    frequencies = [f for (t, f) in missiles]
    d = []
    for freq in frequencies:
        (low, high) = (-1, len(d))
        while high - low >= 1:
            mid = (low + high) // 2
            if d[mid] > freq:
                low = mid
            else:
                high = mid
        if high == len(d):
            d.append(freq)
        else:
            d[high] = freq
    return len(d)

